(8776, 3, '2018-12-28', '09:00:00', '2018-12-28', '00:00:00', 'ตรวจเยี่ยมจุดตรวจบูรณาการป้องกันและลดอุบัติเหตุทางถนนช่วงเทศกาลปีใหม่ 2562 จังหวัดพังงา', 'สนง.ป้องกันและบรรเทาสาธารณภัยจังหวัดพังงา(สำนักงานเลขานุการศูนย์ปฏิบัติการฯ)/076 460607', '1. อำเภอคุระบุรี\r\n    - จุดตรวจหลัก - หน้า รพ.สต. เตรียม ม.4 ต.เตรียม\r\n                        - ปากทางเข้าอุทยานแห่งชาติศรีพังงา ม. 2 ต.บางวัน\r\n    - จุดตรวจรอง  - จุดบริการประชาชนหน้าป้อมยามตลาดนางย่อน ม.8 ต.คุระ\r\n                       - จุดบริการประชาชนของหน่วยกู้ชีพกู้ภัยชัยพัฒน์ หน้า รพ.คุระบุรีชัยพัฒน์ \r\n                         ม. 1 ต.คุระ \r\n2. อ.ตะกั่วป่า\r\n    - จุดตรวจหลัก - บริเวณหน้าป้อมตำรวจเขาหลัก ม.7 ต.คึกคัก\r\n                        - บริเวณด่านตรวจถาวรสามแยกบ้านทับกำ ม.5 ต.บางนายสี\r\n                        - บริเวณสามแยกหินดาน (ด่านตำรวจ)\r\n    - จุดตรวจรอง - หน้า อบต.บางม่วง ม. 1 ต.บางม่วง\r\n                      - จุดตรวจโคบัง ม.7 ต.คึกคัก\r\n3. อ.กะปง\r\n    - จุดตรวจหลัก - หน่วยบริการประชาชนสามแยกเหมาะ ม. 1 ต.เหมาะ\r\n                       - ที่พักสายตรวจรมณีย์ ม.4 ต.รมณีย์\r\n    - จุดตรวจรอง - ที่พักสายตรวจ ต.เหล ม.2\r\n                       - จุดบริการประชาชนบ้านช้างเชื่อ ม.4 ต.เหล', 'อ.คุระบุรี อ.ตะกั่วป่า อ.กะปง', 'เดินทางออกจากศูนย์ราชการฯ เวลา 09.00 น. (รถของสำนักงานขนส่งจังหวัดพังงา)'),
