(9086, 3, '2019-02-21', '08:30:00', '2019-02-21', '16:00:00', 'เข้าร่วมงาน สวทช.-วิทย์สัญจร "วิจัยเข้มแข็ง เสริมแกร่งภูมิภาค"', 'สนจ.(ยุทธศาสตร์) / 076-481424', '-', 'ศูนย์ประชุมนานาชาติฉลองสิริราชสมบัติครบ 60 ปี อำเภอหาดใหญ่ จังหวัดสงขลา', 'ผวจ.มอบหมาย'),
(9087, 2, '2019-02-12', '07:45:00', '2019-02-12', '00:00:00', 'ร่วมกิจกรรมสภากาแฟยามเช้าสภาเกษตรกรจังหวัดพังงา ', 'สนง.สภาเกษตรกรจังหวัดพังงา	076-414517', '-', 'ณ สำนักงานสภาเกษตรกรจังหวัดพังงา		', '-'),
(9088, 2, '2019-02-12', '10:00:00', '2019-02-12', '00:00:00', 'ประธานตรวจการจ้างโครงการก่อสร้างท่าเทียบเรือบ้านป่ายาง', 'ปค.076 481455', '-', 'ณ ท่าเทียบเรือน ม.10 ต.กะไหล อ.ตะกั่วทุ่ง จ.พังงา', '-'),
(9089, 2, '2019-02-12', '13:30:00', '2019-02-12', '00:00:00', 'ประธานการประชุมพิจารณาเพื่อแก้ไขปัญหาความขัดแย้งระหว่างนายกเทศมนตรีเมืองตะกั่วป่าและปลัดเทศบาลเมืองตะกั่วป่า', 'สถ. 076 481435', '-', 'ณ ห้องประชุมสำนักงานส่งเสริมการปกครองท้องถ่ินจังหวัดพังงา ชั้น 3 ศูนย์ราชการจังหวัดพังงา', '-'),
(9090, 2, '2019-02-12', '15:30:00', '2019-02-12', '00:00:00', 'ประธานตรวจการจ้างโครงการท่าเรือชุมชนบ้านปากเกาะ หมู่ที่ 3 ต.เกาะคอเขา อ.เกาะคอเขา อ.ตะกั่วป่า จังหวัดพังงา', 'สนง.โยธาธิการฯ 076460625', '-', 'ณ ท่าเรือชุมชนบ้านปากเกาะ หมู่ 3 ต.เกาะคอเขา อ.ตะกั่วป่า จ.พังงา', '-'),
(9092, 4, '2019-02-13', '10:00:00', '2019-02-13', '00:00:00', 'ประชุมอนุกรรมการตรวจสอบและกลั่นกรองผลงานการประเมินเพื่อเลื่อนระดับ(นอกระดับควบ)ของพนักงานส่วนตำบล', 'สนง.ทถจ. 076-481-435', '-', 'ห้องประชุมสำนักงานส่งเสริมการปกครองท้องถิ่นจังหวัดพังงา  ชั้น 3 ศาลากลางจังหวัด', ''),
(9093, 4, '2019-02-14', '10:00:00', '2019-02-14', '00:00:00', 'ประชุมคณะทำงานเฝ้าระวังปัญหายาเสพติด    (โต๊ะข่าว) จังหวัดพังงา', 'ศอ.ปส.พง.', '-', 'ห้องประชุม 2 ชั้น 3 ศาลากลางจังหวัดพังงา', ''),
(9094, 4, '2019-02-15', '09:00:00', '2019-02-15', '00:00:00', 'ตรวจผลงานตามโครงการคัดเลือกหมู่บ้านดีเด่น (บ้านสวย เมืองสุข) ประจำปี 2562 บ้านทุ่งคาโงก หมู่ที่ 1 ตำบลทุ่งคาโงก อำเภอเมืองพังงา', 'ที่ทำการปกครองจังหวัดพังงา กลุ่มงานปกครอง', '-', 'ศาลาอเนกประสงค์ประจำหมู่บ้าน บ้านทุ่งคาโงก หมู่ที่ 1  ตำบลทุ่งคาโงก อำเภอเมืองพังงา', ''),
(9095, 4, '2019-02-15', '13:30:00', '2019-02-15', '00:00:00', 'ตรวจผลงานตามโครงการคัดเลือกหมู่บ้านดีเด่น (บ้านสวย เมืองสุข) ประจำปี 2562 บ้านกะปง หมู่ที่ 2 ตำบลกะปง อำเภอกะปง', 'ที่ทำการปกครองจังหวัดพังงา กลุ่มงานปกครอง', '-', 'ศาลาอเนกประสงค์ประจำหมู่บ้าน บ้านกะปง หมู่ที่ 2 ตำบลกะปง อำเภอกะปง', ''),
(9098, 3, '2019-02-26', '09:30:00', '2019-02-26', '00:00:00', 'ประธานคณะกรรมการกลั่นกรองการดำเนินการตาม พรบ.โรงแรม พ.ศ.2547', 'ที่ทำการปกครองจังหวัดพังงา (กลุ่มงานปกครอง) /076-481455', '-', 'สถานประกอบการโรงแรม ๗ แห่ง ในพื้นที่อำเภอตะกั่วป่า จ.พังงา ', '-'),
(9099, 3, '2019-02-27', '09:00:00', '2019-02-27', '00:00:00', 'ประชุมคณะกรมการจังหวัด หัวหน้าส่วนราชการ นายอำเภอ หัวหน้าหน่วยงานรัฐวิสาหกิจ ผู้บริหาร อปท. และภาคเอกชน ครั้งที่ 2/2562', 'สนจ.(อำนวยการ) / 076-481424', '-', 'ห้องประชุม 1 ชั้น 2 ศาลากลางจังหวัด ศูนย์ราชการจังหวัดพังงา อ.เมืองฯ จ.พังงา ', '- '),
(9100, 2, '2019-02-14', '15:00:00', '2019-02-14', '00:00:00', 'ร่วมการแถลงข่าวการจัดวางประติมากรรมฮาร์ลีย์ - เดวิดสัน', 'มูลนิธีรักษ์เขาหลัก 076 428555', '-', 'ณ เวทีหลัก โซนสแควร์ 8 ศูนย์การค้าเซ็นทรัลเวิลด์ (ราชประสงค์ กทม.)', 'ผวจ.มอบหมาย  การแต่งกาย ชุดสุภาพสากลนิยม  คณะผู้จัดทำ ขอนัดเวลา 14.00 น. เพื่อชี้แจงซักซ้อมก่อนขั้นเวทีแถลงข่าว '),
(9101, 2, '2019-02-15', '08:30:00', '2019-02-15', '00:00:00', 'ร่วมประชุมสัมมนา "การส่งเสริมและพัฒนาองค์กร ชุมชน อำเภอ และจังหวัดคุณธรรม" ภายใต้แผนแม่บทส่งเสริมคุณธรรมแห่งชาติ ฉบับที่ 1 พ.ศ. 2559 - 2564', 'สนจ.บุคคล  0-7641-2140', '-', 'ณ โรงแรมทาวน์ อิน ทาวน์ เขตวังทองหลาง กรุงเทพฯ ', 'ผวจ.มอบหมาย'),
